import React from "react";
import { Grid, Image, Container, Icon, Card, Divider } from "semantic-ui-react";
import Tools from "./Tools.js";
import PageTitle from "../../PageTitle/PageTitle";
import skills from "./images/_white.png";
import tools from "./images/tools_white.png";
import "./style.css";

const Skills = () => (
  <div>
    <Container id="skills">
      <div className="wrapper">
        <PageTitle title="Familiar" image={skills} secondImage={tools} />
        <Tools />
      </div>
    </Container>
  </div>
);

export default Skills;
